readToken :: P Token
readToken = do
  s <- get
  case alexScan s 0 of
    AlexEOF -> return TEOF
    AlexError inp' -> throwError $ "Error while lexing: " ++ takeWhile (/= ' ') (snd inp')
    AlexSkip inp' _ -> put inp' >> readToken
    AlexToken inp' len action -> do
        let tk = action $ take len (snd s)
        put inp'
        return tk


